from core.constant import constant#%% Templatetemplate   = constant(                    abbrev          = 'template',                    name            = '',                    value           = 5.670374419*(10**(-8)),                    uncertainty     = 0,                    unit            = '',                    value_ref       = '',                    value_ref_link  = '',                    u_ref           = '',                    u_ref_link      = ''                   )#%% Fundamental Physical Constantssigma   = constant(                    abbrev          = 'sigma',                    name            = 'Stefan-Boltzmann constant',                    value           = 5.670374419*(10**(-8)),                    uncertainty     = 0,                    unit            = 'W/(m^2*K^4)',                    value_ref       = 'NIST',                    value_ref_link  = 'https://physics.nist.gov/cgi-bin/cuu/Value?sigma',                    u_ref           = 'NIST',                    u_ref_link      = 'https://physics.nist.gov/cgi-bin/cuu/Value?sigma'                   )#%% Astronomical ConstantsG       = constant(                    abbrev          = 'G',                    name            = 'gravitational constant',                    value           = 6.67428*(10**(-11)),                    uncertainty     = 6.7*(10**(-15)),                    unit            = '(m^3)/(kg*s^2)',                    value_ref       = 'IAU',                    value_ref_link  = 'https://apps.dtic.mil/sti/tr/pdf/ADA551834.pdf',                    u_ref           = 'IAU',                    u_ref_link      = 'https://apps.dtic.mil/sti/tr/pdf/ADA551834.pdf'                   )c       = constant(                    abbrev          = 'c',                    name            = 'speed of light',                    value           = 299792458.0,                    uncertainty     = 0,                    unit            = 'm/s',                    value_ref       = '',                    value_ref_link  = '',                    u_ref           = '',                    u_ref_link      = ''                   )tau_A   = constant(                    abbrev          = 'tau_A',                    name            = 'light-time',                    value           = 499.0047863852,                    uncertainty     = 4.0*(10**-11),                    unit            = 's',                    value_ref       = 'IERS Conventions (2003)',                    value_ref_link  = 'https://web.archive.org/web/20131219165433/http://www.iers.org/IERS/EN/Publications/TechnicalNotes/tn32.html',                    u_ref           = 'IERS Conventions (2003)',                    u_ref_link      = 'https://web.archive.org/web/20131219165433/http://www.iers.org/IERS/EN/Publications/TechnicalNotes/tn32.html'                   )AU   = constant(                    abbrev          = 'AU',                    name            = 'astronomical unit',                    value           = 1.49597870700*(10**11),                    uncertainty     = 3,                    unit            = 'm',                    value_ref       = 'IAU',                    value_ref_link  = 'https://apps.dtic.mil/sti/tr/pdf/ADA551834.pdf',                    u_ref           = 'IAU',                    u_ref_link      = 'https://apps.dtic.mil/sti/tr/pdf/ADA551834.pdf'                   )#%% Planetary Values#%%% Planetary J2 ValuesJ2_earth    = constant(                    abbrev          = 'J2_earth',                    name            = 'J2 constant for Earth',                    value           = 0.0010826359,                    uncertainty     = 1*(10**-10),                    unit            = '',                    value_ref       = 'IAU',                    value_ref_link  = 'https://apps.dtic.mil/sti/tr/pdf/ADA551834.pdf',                    u_ref           = 'IAU',                    u_ref_link      = 'https://apps.dtic.mil/sti/tr/pdf/ADA551834.pdf'                   )J2_mars     = constant(                    abbrev          = 'J2_mars',                    name            = 'J2 constant for Mars',                    value           = 0.001964,                    uncertainty     = None,                    unit            = '',                    value_ref       = '',                    value_ref_link  = 'http://astro.vaporia.com/start/j2.html',                   )J2_jupiter  = constant(                    abbrev          = 'J2_jupiter',                    name            = 'J2 constant for Jupiter',                    value           = 0.01475,                    uncertainty     = None,                    unit            = '',                    value_ref       = '',                    value_ref_link  = 'http://astro.vaporia.com/start/j2.html',                   )J2_saturn   = constant(                    abbrev          = 'J2_saturn',                    name            = 'J2 constant for Saturn',                    value           = 0.01656,                    uncertainty     = None,                    unit            = '',                    value_ref       = '',                    value_ref_link  = 'http://astro.vaporia.com/start/j2.html',                   )#%%% Earth System Valuese_J2000   = constant(                    abbrev          = 'e_J2000',                    name            = 'Obliquity of the ecliptic at J2000.0',                    value           = 8.4381406*(10**4),                    uncertainty     = 1*(10**(-3)),                    unit            = 'arcseconds',                    value_ref       = 'IAU',                    value_ref_link  = 'https://apps.dtic.mil/sti/tr/pdf/ADA551834.pdf',                   )#%%% Planetary Gravitational ParametersGM_sun   = constant(                    abbrev          = 'GM_sun',                    name            = 'Heliocentric graviational constant, TCB-compatible',                    value           = 1.32712442099*(10**20),                    uncertainty     = 1*(10**10),                    unit            = 'm**3/s**2',                    value_ref       = 'IAU',                    value_ref_link  = 'https://apps.dtic.mil/sti/tr/pdf/ADA551834.pdf',                   )GM_E   = constant(                    abbrev          = 'GM_E',                    name            = 'Geocentric graviational constant, TCB-compatible',                    value           = 3.986004418*(10**14),                    uncertainty     = 1*(10**10),                    unit            = 'm**3/s**2',                    value_ref       = 'IAU',                    value_ref_link  = 'https://apps.dtic.mil/sti/tr/pdf/ADA551834.pdf',                   )#%%% Planetary Mass RatiosMs_Mme   = constant(                    abbrev          = 'Ms_Mme',                    name            = 'Ratio of Sun mass to Mercury mass',                    value           = 6.0236*(10**6),                    uncertainty     = 3*(10**2),                    unit            = '',                    value_ref       = 'IAU',                    value_ref_link  = 'https://apps.dtic.mil/sti/tr/pdf/ADA551834.pdf',                   )Ms_Mve   = constant(                    abbrev          = 'Ms_Mve',                    name            = 'Ratio of Sun mass to Venus mass',                    value           = 4.08523719*(10**5),                    uncertainty     = 8*(10**-3),                    unit            = '',                    value_ref       = 'IAU',                    value_ref_link  = 'https://apps.dtic.mil/sti/tr/pdf/ADA551834.pdf',                   )Mm_Me   = constant(                    abbrev          = 'Mm_Me',                    name            = 'Ratio of Moon mass to Earth mass',                    value           = 1.23000371*(10**-2),                    uncertainty     = 4*(10**-10),                    unit            = '',                    value_ref       = 'IAU',                    value_ref_link  = 'https://apps.dtic.mil/sti/tr/pdf/ADA551834.pdf',                   )Ms_Mma   = constant(                    abbrev          = 'Ms_Mma',                    name            = 'Ratio of Sun mass to Mars mass',                    value           = 3.09870359*(10**6),                    uncertainty     = 2*(10**-2),                    unit            = '',                    value_ref       = 'IAU',                    value_ref_link  = 'https://apps.dtic.mil/sti/tr/pdf/ADA551834.pdf',                   )Ms_Mj   = constant(                    abbrev          = 'Ms_Mj',                    name            = 'Ratio of Sun mass to Jupiter mass',                    value           = 1.047348644*(10**6),                    uncertainty     = 1.7*(10**-5),                    unit            = '',                    value_ref       = 'IAU',                    value_ref_link  = 'https://apps.dtic.mil/sti/tr/pdf/ADA551834.pdf',                   )Ms_Msa  = constant(                    abbrev          = 'Ms_Msa',                    name            = 'Ratio of Sun mass to Saturn mass',                    value           = 3.4979018*(10**3),                    uncertainty     = 1*(10**-4),                    unit            = '',                    value_ref       = 'IAU',                    value_ref_link  = 'https://apps.dtic.mil/sti/tr/pdf/ADA551834.pdf',                   )Ms_Mu   = constant(                    abbrev          = 'Ms_Mu',                    name            = 'Ratio of Sun mass to Uranus mass',                    value           = 2.290298*(10**4),                    uncertainty     = 3*(10**-2),                    unit            = '',                    value_ref       = 'IAU',                    value_ref_link  = 'https://apps.dtic.mil/sti/tr/pdf/ADA551834.pdf',                   )Ms_Mn   = constant(                    abbrev          = 'Ms_Mn',                    name            = 'Ratio of Sun mass to Neptune mass',                    value           = 1.941226*(10**4),                    uncertainty     = 3*(10**-2),                    unit            = '',                    value_ref       = 'IAU',                    value_ref_link  = 'https://apps.dtic.mil/sti/tr/pdf/ADA551834.pdf',                   )Ms_Mp   = constant(                    abbrev          = 'Ms_Mp',                    name            = 'Ratio of Sun mass to Pluto mass',                    value           = 1.36566*(10**8),                    uncertainty     = 2.8*(10**4),                    unit            = '',                    value_ref       = 'IAU',                    value_ref_link  = 'https://apps.dtic.mil/sti/tr/pdf/ADA551834.pdf',                   )#%%% Planetary MassesM_Sun   = constant(                    abbrev          = 'M_Sun',                    name            = 'Mass of the sun',                    value           = (GM_sun/G),                    uncertainty     = (GM_sun/G),                    unit            = 'kg',                    value_ref       = 'IAU',                    value_ref_link  = 'https://apps.dtic.mil/sti/tr/pdf/ADA551834.pdf'                    )M_Me    = constant(                    abbrev          = 'M_Me',                    name            = 'Mass of Mercury',                    value           = (M_Sun/Ms_Mme),                    uncertainty     = (M_Sun/Ms_Mme),                    unit            = 'kg',                    value_ref       = 'IAU',                    value_ref_link  = 'https://apps.dtic.mil/sti/tr/pdf/ADA551834.pdf',                   )M_Ve    = constant(                    abbrev          = 'M_Ve',                    name            = 'Mass of Venus',                    value           = (M_Sun/Ms_Mve),                    uncertainty     = (M_Sun/Ms_Mve),                    unit            = 'kg',                    value_ref       = 'IAU',                    value_ref_link  = 'https://apps.dtic.mil/sti/tr/pdf/ADA551834.pdf',                   )M_E     = constant(                    abbrev          = 'M_E',                    name            = 'Mass of the Earth',                    value           = (GM_E/G),                    uncertainty     = (GM_E/G),                    unit            = 'kg',                    value_ref       = 'IAU',                    value_ref_link  = 'https://apps.dtic.mil/sti/tr/pdf/ADA551834.pdf',                   )M_M     = constant(                    abbrev          = 'M_M',                    name            = 'Mass of Luna',                    value           = (Mm_Me*M_E),                    uncertainty     = (Mm_Me*M_E),                    unit            = 'kg',                    value_ref       = 'IAU',                    value_ref_link  = 'https://apps.dtic.mil/sti/tr/pdf/ADA551834.pdf',                   )M_Ma    = constant(                    abbrev          = 'M_Ma',                    name            = 'Mass of Mars',                    value           = (M_Sun/Ms_Mma),                    uncertainty     = (M_Sun/Ms_Mma),                    unit            = 'kg',                    value_ref       = 'IAU',                    value_ref_link  = 'https://apps.dtic.mil/sti/tr/pdf/ADA551834.pdf',                   )M_J     = constant(                    abbrev          = 'M_J',                    name            = 'Mass of Jupiter',                    value           = (M_Sun/Ms_Mj),                    uncertainty     = (M_Sun/Ms_Mj),                    unit            = 'kg',                    value_ref       = 'IAU',                    value_ref_link  = 'https://apps.dtic.mil/sti/tr/pdf/ADA551834.pdf',                   )M_Sa     = constant(                    abbrev          = 'M_sa',                    name            = 'Mass of Saturn',                    value           = (M_Sun/Ms_Msa),                    uncertainty     = (M_Sun/Ms_Msa),                    unit            = 'kg',                    value_ref       = 'IAU',                    value_ref_link  = 'https://apps.dtic.mil/sti/tr/pdf/ADA551834.pdf',                   )M_U     = constant(                    abbrev          = 'M_U',                    name            = 'Mass of Uranus',                    value           = (M_Sun/Ms_Mu),                    uncertainty     = (M_Sun/Ms_Mu),                    unit            = 'kg',                    value_ref       = 'IAU',                    value_ref_link  = 'https://apps.dtic.mil/sti/tr/pdf/ADA551834.pdf',                   )M_N     = constant('M_U',                   'Mass of Neptune',                   (M_Sun/Ms_Mn),                   (M_Sun/Ms_Mn),                   'kg',                   'IAU',                   'https://apps.dtic.mil/sti/tr/pdf/ADA551834.pdf',                   )M_P     = constant('M_U',                   'Mass of Pluto',                   (M_Sun/Ms_Mp),                   (M_Sun/Ms_Mp),                   'kg',                   'IAU',                   'https://apps.dtic.mil/sti/tr/pdf/ADA551834.pdf',                   )M_charon= constant('M_charon',                   'Mass of Charon',                   1.5897*(10**21),                   0.0045*(10**21),                   'kg',                   'Brozović, Marina; Jacobson, Robert A. (May 8, 2024)',                   'https://doi.org/10.3847%2F1538-3881%2Fad39f0',                   )M_Pbc   = constant('M_Pbc',                   'Mass of Pluto Barycenter',                   (M_P+M_charon),                   (M_P+M_charon),                   'kg',                   'IAU and Brozović, Marina; Jacobson, Robert A. (May 8, 2024)',                   )